import React, {  } from 'react';
 import { Link } from 'react-router-dom';
// import { Row, Col, Card } from 'react-bootstrap';
import Header2 from '../layout/header2';
import Sidebar from '../layout/sidebar';
// import PageTitle from '../element/page-title';
import Footer2 from '../layout/footer2';



function VerifyStep4() {

    return (
        <>
            <Header2 />
            <Sidebar />
            
            <div class="verification section-padding">
            <div class="container h-100">
                <div class="row justify-content-center h-100 align-items-center">
                    <div class="col-xl-5 col-md-6">
                        <div class="auth-form card">
                            <div class="card-body">
                                <form  class="identity-upload">
                                    <div class="identity-content">
                                        <span class="icon"><i class="fa fa-check"></i></span>
                                        <h4>Identity Verified</h4>
                                        <p>Congrats! your identity has been successfully verified and your investment
                                            limit has been increased.</p>
                                    </div>

                                    <div class="text-center mb-4">
                                        <Link to={"./add-debit-card"} class="btn btn-success pl-5 pr-5">Continue</Link>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>

            <Footer2 />
        </>
    )
}

export default VerifyStep4;
